import React from "react";
import {Title} from './Title';
import styled, { css } from 'styled-components';
const Image_top = styled.img`
    margin-top: 50px;
    margin-bottom: 20px;
`;
function Service() {
    return(
        <>
        <Title/>
        <div className="col-sm-8 row mx-auto text-center"> 
            <Image_top src="./images/service_auto.png"></Image_top>
        </div>
        </>
    );
}
export {Service};
